import {
  FETCH_PRODUCTS,
  // FILTER_PRODUCTS_BY_SIZE,
  // ORDER_PRODUCTS_BY_PRICE,
} from "./types";

export const fetchProducts = () => (dispatch) => {
  fetch("http://localhost:8000/products")
    .then((res) => res.json())
    .catch((err) =>
      fetch("db.json")
        .then((res) => res.json())
        .then((data) => data.products)
    )
    .then((data) => {
      dispatch({ type: FETCH_PRODUCTS, payload: data });
    });
};
